import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import './App.css';
import Menu from "./component/pages/menu"
import { FooterDown} from "./component/pages/footer"

function App() {
  return (
    <div className="App">
      <Menu />
      <div className="sidebar">
        <div>
          <li>item1</li>
          <li>item2</li>
          <li>item3</li>
          <li>item4</li>
          <li>item5</li>
        </div>
      </div>

      <div className="footer">
        <FooterDown />
      </div>
    </div>
  );
}

export default App;
